function DrawATMRaw(btn, cardState, withdrawState, depositState){
    displayDiv.style.left = (canvas.getBoundingClientRect().left+272)+"px";
    displayDiv.style.top = (canvas.getBoundingClientRect().top+331)+"px";
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(images.main, 0, 0, canvas.width, canvas.width);
    if(cardState !== -1){
        ctx.drawImage(images.card, 715-(cardState*0.2), 470-(cardState*0.5), scale*120, scale*58);
        ctx.drawImage(images.cardSlot, 660, 410, scale*201, scale*75);
    }
    if(withdrawState !== -1){
        ctx.drawImage(images.withdrawBottom, 269, 550, scale*242, scale*16);
        ctx.drawImage(images.withdrawBill, 295+(Math.min(withdrawState,100)*0.1), 512+(Math.min(withdrawState,100)*0.35), scale*160, scale*45);
        ctx.drawImage(images.withdrawTop, 269, 512, scale*242, scale*46);
    }
    if(depositState !== -1){
        ctx.drawImage(images.depositBottom, 640, 725, scale*181, scale*16);
        ctx.drawImage(images.depositBill, 670-((Math.max(depositState,50)-50)*0.5), 730-((Math.max(depositState,50)-50)*1.6), scale*180, scale*185);
        ctx.drawImage(images.depositTop, 614, 563, scale*252, scale*194);
    }
    if(btn !== undefined){
        if(btn.color !== undefined){
            ctx.fillStyle = btn.color;
        }else{
            ctx.fillStyle = "rgba(200, 200, 200, 0.5)";
        }
        ctx.fillRect(btn.x1, btn.y1, btn.x2-btn.x1, btn.y2-btn.y1);
    }
}

function GetButtonAt(x, y){
    for(let btn of buttons){
        if(x >= btn.x1 && x <= btn.x2 && y >= btn.y1 && y <= btn.y2){
            return btn;
        }
    }
}

setInterval(() => {
    if(drawCardState !== -1){
        drawCardState += drawCardDirection * 5;
        if(drawCardState < 0){
            drawCardDirection = 0;
            drawCardState = -1;
        }
        if(drawCardState > 100){
            drawCardDirection = 0;
            drawCardState = -1;
        }
    }
    if(drawWithdrawState !== -1){
        drawWithdrawState += 4;
        if(drawWithdrawState > 200){
            drawWithdrawState = -1;
        }
    }
    if(drawDepositState !== -1){
        drawDepositState += 4;
        if(drawDepositState > 150){
            drawDepositState = -1;
        }
    }
    let btn = GetButtonAt(lastPos.offsetX, lastPos.offsetY);
    DrawATMRaw(btn, drawCardState, drawWithdrawState, drawDepositState);
}, 50);

canvas.addEventListener("mousemove", e => {
    lastPos = e;
}, false);

canvas.addEventListener("mousedown", e => {
    if(e.button === 0){
        let btn = GetButtonAt(e.offsetX, e.offsetY);
        if(btn !== undefined){
            ue.game.callevent("ATMButton", JSON.stringify([btn.name]));
        }
    }
}, false);

